from string import ascii_lowercase
practice = 'dabAcCaCBAcCcaDA'
workfile = ''
fullword = workfile
min_len = len(fullword)
for c in ascii_lowercase:
    word = fullword.replace(c, '')
    word = word.replace(c.upper(), '')

    while True:
        ix = -1
        old_word = word
        for li, letter in enumerate(word):
            if li == len(word)-1:
                break
            if letter.lower() == word[li+1].lower() and letter != word[li+1]:
                ix = li
                break

        if ix < 0:
            break
        else:
            word = word[0:ix] + word[ix+2:]
        if old_word == word:
            print(f"no change to word: {old_word} == {word}")
            break

    if len(word) < min_len:
        min_len = len(word)
        print(f"Min Len: {min_len}")

print(f"Result: {min_len}")

